import React, {useEffect, useState} from 'react'

const CartPage = () => {

    let [Orders, setOrder] = useState([])

    useEffect(() => {
        getOrders()
    }, [])

    let getOrders = async () => {
        let response = await fetch('http://127.0.0.1:8000/cart')
        let data = await response.json()
        setOrder(data)
    }

  return (
    <div>
        {Orders.map((order, index) => (
            <h1>{order.amount}</h1>
        ))}
    </div>
  )
}

export default CartPage
